INSERT INTO w_dishes_lang VALUES (1560, 1535, 1, 'CAFE MOCHA', 'A delicious combination of rich chocolate flavour and bold coffee that provides a sweet, indulgent treat! The best Mocha''s will use a dark drinking chocolate mixed with perfectly brewed espresso, gently stirred to combine then served with Latte style steamed milk. The use of a dark chocolate powder ensures that the drink  will not be overly sweet compared to a milk chocolate or syrup. Best enjoyed on a cool winters day, it''s the perfect mix between a coffee and a hot chocolate. For extra indulgence serve topped with whipped cream.', true, '', '');;
