INSERT INTO w_dishes_lang VALUES (1542, 1517, 1, 'BBLT', 'Made with six thick slices of applewood smoked bacon, tomatoes, leaf lettuce and our very own cracked pepper balsamic mayo on Mom''s white toast. 
INSERT INTO w_dishes_lang VALUES (1368, 1343, 1, 'Cheese!!!', 'Our delicious Three Cheese Pizza starts with our savory sauce of vine-ripened tomatoes, extra-virgin olive oil, garlic, and spices spread over Udi''s baked-to-perfection thin and crispy gluten free crust. We top it off with our premium cheese blend of mozzarella, parmesan, and romano and sprinkle fresh-frozen basil to create a flavorful crowd pleaser.
INSERT INTO w_dishes_lang VALUES (1378, 1353, 1, 'Dark GD', 'Gin and dry vermouth, and perhaps a dash of orange bitters
INSERT INTO w_dishes_lang VALUES (1369, 1344, 1, 'Pepperoni Pizza', 'Our robust, tasty Pepperoni Pizza starts with our savory sauce of vine-ripened tomatoes, extra virgin olive oil, garlic, and spices spread over a baked-to-perfection thin and crispy gluten free crust. We top it off with premium mozzarella, a sprinkling of fresh-frozen basil and layer on uncured pepperoni for a hearty and satisfying indulgence.
INSERT INTO w_dishes_lang VALUES (1562, 1537, 1, 'LONG BLACK / CAFFE AMERICANO', 'A long black is usually served in a taller glass or mug, this is based on a 30ml shot of espresso. Hot water is then added to this and served black. The term ''long'' here refers to the fact that the volume has been increased by adding hot water. For larger drinks a double shot of espresso may be used to maintain the ratio of water to coffee.', true, '', '');;
INSERT INTO w_dishes_lang VALUES (1569, 1544, 1, 'GRILY 3', '19 ounces of sheer perfection—full-bodied and full of flavor. Ruth''s favorite cut.
INSERT INTO w_dishes_lang VALUES (1543, 1518, 1, 'Southwest Chicken', 'All-natural grilled chicken, cabbage, corn salsa, tomatoes and house-pickled jalanenos drizzled with avocado ranch dressing on grilled flatbread. 
INSERT INTO w_dishes_lang VALUES (1563, 1538, 1, 'VIENNA', 'A vienna is simply a long black served with whipped cream as a replacement for milk and sugar.
INSERT INTO w_dishes_lang VALUES (1375, 1350, 1, 'Audrefw chaute', 'An irresistible wine whose elegance draws you subliminally into its orbit. Intense ruby-garnet in color, it is redolent of a profusion of aromas of coffee, cherries and sun dried fruits. Its high alcohol makes it full and generous in the mouth and it overwhelms the palate with intense flavors, prolonging your pleasure with its characteristic slightly bitter finish.
INSERT INTO w_dishes_lang VALUES (226, 226, 1, 'Sauvignon Blanc', 'Surprisingly smooth without any of the tart tannin. The fruity bouquet is rendered more enticing due to a hint of cassis, rich and dark in color, it delivers complex varietal flavors of cherries and blackberries, with a promise of herbs. 
INSERT INTO w_dishes_lang VALUES (1379, 1354, 1, 'Grapes Wine', 'Recognized for its intensity of color and good structure of tannin and acid, it presents nuances of gooseberries and a smoky, peppery bouquet and is often added to a blend to liven it up. Smooth on the palate this wine ages well and mellows with time. 
INSERT INTO w_dishes_lang VALUES (225, 225, 1, 'Pinot Grigio', 'A medium-bodied red with a medium color. This wine has floral notes accompanied by ripe fruit. On the palate it has a smooth, well balanced, velvety structure. 
INSERT INTO w_dishes_lang VALUES (1376, 1351, 1, 'Martche', 'A wine that evokes legend and fascination with its brilliant garnet-red and flashes of amber. The bouquet is both pleasing and intense with aromatic notes of violets and oregano. Smooth in the mouth with crisp acidity, its firm but well integrated tannins give good length on the palate.  It is a wine that exudes glory, nobility and power.
INSERT INTO w_dishes_lang VALUES (228, 228, 1, 'Chardonnay', 'This supple, fruity and delicate red wine is best consumed young. Cherries and plums fill the nose and the sweet cherry follows through the mouth where it lingers . This refreshing wine is best served slightly chilled. It suits desserts and is excellent as an aperitif.
INSERT INTO w_dishes_lang VALUES (1377, 1352, 1, 'Red Do', 'Rye whisky, sweet vermouth, and Angostura bitters
INSERT INTO w_dishes_lang VALUES (223, 223, 1, 'XX Lager', 'Yuengling, Killian’s, Brooklyn Lager) – More malt and darker than their lighter lager relatives, usually amber to copper colored. Flavor profiles vary considerably between breweries. Nine times out of ten when a beer label says no more than “Lager” it is an amber.', true, '', '');;
INSERT INTO w_dishes_lang VALUES (1448, 1423, 1, 'Sauvignon Blanc', 'Surprisingly smooth without any of the tart tannin. The fruity bouquet is rendered more enticing due to a hint of cassis, rich and dark in color, it delivers complex varietal flavors of cherries and blackberries, with a promise of herbs. 
INSERT INTO w_dishes_lang VALUES (1449, 1424, 1, 'THE DEAD RABBIT IRISH COFFEE', 'We’ve tried many recipes for the delicious and classic Irish Coffee, but this one, from top mixologist Jack McGarry of famed New York bar The Dead Rabbit, is our favorite. The secret is a bit of Demerara sugar syrup and hand-whipped cream. You’re bound to love this recipe as much as we do!
INSERT INTO w_dishes_lang VALUES (1450, 1425, 1, 'AUTUMN WASSAIL', 'Having a party? Whip up this spirited fall drink that features apple cider, pomegranate, cognac and a bit of rum. The best part? It can be served hot or cold.
INSERT INTO w_dishes_lang VALUES (1451, 1426, 1, 'Corona Extra', 'These distinctively northern English style ales have a strong, malty center and can be nutty, sweet and very lightly hopped. They are medium bodied and the name matches the color of the ale.', true, NULL, NULL);;
INSERT INTO w_dishes_lang VALUES (1452, 1427, 1, 'Pinot Grigio', 'A medium-bodied red with a medium color. This wine has floral notes accompanied by ripe fruit. On the palate it has a smooth, well balanced, velvety structure. 
INSERT INTO w_dishes_lang VALUES (1453, 1428, 1, 'Chardonnay', 'This supple, fruity and delicate red wine is best consumed young. Cherries and plums fill the nose and the sweet cherry follows through the mouth where it lingers . This refreshing wine is best served slightly chilled. It suits desserts and is excellent as an aperitif.
INSERT INTO w_dishes_lang VALUES (1454, 1429, 1, 'XX Lager', 'Yuengling, Killian’s, Brooklyn Lager) – More malt and darker than their lighter lager relatives, usually amber to copper colored. Flavor profiles vary considerably between breweries. Nine times out of ten when a beer label says no more than “Lager” it is an amber.', true, NULL, NULL);;
INSERT INTO w_dishes_lang VALUES (1455, 1430, 1, 'Pinot Noir', 'A big, full-bodied wine that is excellent as a before or after dinner drink. This deeply colored wine of purples and reds is sweet and aromatic. Its delectable smoothness is due to a low acid content, delivering a rich earthy flavor, but it is mainly used to increase the intensity of color and body in other grape varieties.  
INSERT INTO w_dishes_lang VALUES (1456, 1431, 1, 'Guinness', 'Pale ale with intense hop flavor and aroma and slightly higher alcohol content.', true, NULL, NULL);;
INSERT INTO w_dishes_lang VALUES (1457, 1432, 1, 'Heineken', 'Very similar to stout but made from, or largely from, unroasted barley. Sweet and dark brown in color with hints of chocolate and a sometimes-sharp bitterness.', true, NULL, NULL);;
INSERT INTO w_dishes_lang VALUES (1458, 1433, 1, 'Stella artois', 'Whether American or English, the “pale” was clipped on long ago to distinguish it from the dark color of Porters. American and English styles differ, but generally they are gold or copper colored and dry with crisp hop flavor.', true, NULL, NULL);;
INSERT INTO w_dishes_lang VALUES (1459, 1434, 1, 'Red Do', 'Rye whisky, sweet vermouth, and Angostura bitters
INSERT INTO w_dishes_lang VALUES (1460, 1435, 1, 'Dark GD', 'Gin and dry vermouth, and perhaps a dash of orange bitters
INSERT INTO w_dishes_lang VALUES (1461, 1436, 1, 'Grapes Wine', 'Recognized for its intensity of color and good structure of tannin and acid, it presents nuances of gooseberries and a smoky, peppery bouquet and is often added to a blend to liven it up. Smooth on the palate this wine ages well and mellows with time. 
INSERT INTO w_dishes_lang VALUES (1462, 1437, 1, 'HOT TODDY', 'This drink is arguably the most famous hot cocktail of all time—not to mention our favorite remedy for a cold—and it’s super simple to make. The original Hot Toddy (also called the Whisky Skin) doesn’t call for any fancy ingredients, just a mix of boiling water, sugar, lemon and whiskey. Our recipe also calls for a few cloves and uses complex turbinado sugar, but it''s just as easy. And, best of all, it works with Scotch, Irish whiskey, bourbon and rye.', true, NULL, NULL);;
INSERT INTO w_dishes_lang VALUES (1463, 1438, 1, 'Audrefw chaute', 'An irresistible wine whose elegance draws you subliminally into its orbit. Intense ruby-garnet in color, it is redolent of a profusion of aromas of coffee, cherries and sun dried fruits. Its high alcohol makes it full and generous in the mouth and it overwhelms the palate with intense flavors, prolonging your pleasure with its characteristic slightly bitter finish.
