INSERT INTO w_lang_admin VALUES (641, 'BUSINESS_SMS_PRINTER', true, NULL, 'Please configure this in order to get your orders from the desktop version, mobile web version, iOS and Android App sent to your printer. The printer will be abel to accept or reject order. Introducing estimated time of delivery and reason of rejection is also possible, everything get update to the user.', 'Bitte konfigurieren Sie diese, um Ihre Aufträge von der Desktop-Version, mobile Web-Version zu bekommen, iOS und Android-App geschickt, um Ihren Drucker. Der Drucker wird abel zu akzeptieren oder abzulehnen, um sein. Einführung geschätzten Zeitpunkt der Lieferung und den Grund für die Ablehnung ist auch möglich, alles bekommen, was Update für den Benutzer.', 'Por favor, configurar esto con el fin de conseguir sus órdenes de la versión de escritorio, la versión web móvil, iOS y Android App envían a la impresora. La impresora será abel para aceptar o rechazar la orden. La introducción de la hora estimada de entrega y la razón del rechazo también es posible, todo get update para el usuario.', 0);;
INSERT INTO w_lang_admin VALUES (642, 'BUSINESS_SMS_NOTIFICATION', true, NULL, 'These notifications are text messages sent to the business owner. If you activate this every time an order is placed a text message will be sent. In order for this to work you have to activate your Twilio App. This settings are place in', 'Diese Mitteilungen sind Kurzmitteilungen an den Eigentümer geschickt. Wenn Sie diese jedes Mal zu aktivieren eine Bestellung aufgegeben wird eine SMS gesendet werden soll. Damit dies funktioniert, um Ihre Twilio App zu aktivieren. Diese Einstellungen sind in', 'Estas notificaciones son mensajes de texto enviados al propietario de la empresa. Si se activa esta cada vez que se hace un pedido se enviará un mensaje de texto. Para que esto funcione tiene que activar su Twilio App. Estos ajustes son lugar en', 0);;
