INSERT INTO w_lang_admin VALUES (643, 'BUSINESS_CASH_DELIVERY', true, NULL, 'This payment method is the traditional typical way of most of the site. The customer orders food online and the pays until the product is delivered to his door. The customer would pay in cash to the driver or delivery service.', 'Diese Zahlungsmethode ist die traditionelle typische Art und Weise die meisten der Website. Die Kundenaufträge Essen bestellen und das zahlt, bis das Produkt, seine Haustür geliefert. Der Kunde würde in bar an den Fahrer oder Lieferservice zu bezahlen.', 'Esta forma de pago es la forma típica tradicional de la mayor parte del sitio. El pedidos de los clientes en línea de alimentos y la paga hasta que el producto se entrega a su puerta. El cliente pagará en efectivo al servicio de conductor o la entrega.', 0);;
INSERT INTO w_lang_admin VALUES (644, '', true, NULL, 'This payment method is almost as cash, there are some businesses that have mobile credit card terminals, those can either be like bank mobile terminal or smartphone credit card processors like Square. Basically the user places and order and pays with his credit card on his address when receiving the order.', 'Diese Zahlungsmethode ist fast wie Bargeld, gibt es einige Unternehmen, die mobilen Kreditkarten-Terminals haben, können diejenigen, entweder wie Bank mobilen Endgerät oder Smartphone Kreditkarten-Prozessoren wie Square. Grundsätzlich sind die Benutzer Orte und Ordnung und zahlt mit seiner Kreditkarte auf seinem Adresse, wenn Eingang der Bestellung.', 'Esta forma de pago es casi tan efectivo, hay algunas empresas que tienen terminales de la tarjeta de crédito móviles, ya sea los que pueden ser como los procesadores bancarios móviles terminales o teléfonos inteligentes de tarjetas de crédito, como la plaza. Básicamente los lugares de los usuarios y el orden y paga con su tarjeta de crédito en su discurso al recibir la orden.', 0);;
INSERT INTO w_lang_admin VALUES (737, 'CONTROL_PANEL_MENU_LOGOUT', true, NULL, 'Log out', 'Abmelden', 'Cerrar sesión', 0);;
INSERT INTO w_lang_admin VALUES (645, '', true, NULL, 'Activating this payment gateway, the money will go 100% to the owner of the Paypal account configured. This method is really easy to setup, just add the business paypal email address to receive the payment and you are done, if the site owner wants to receive all the payments and then pay to the business owner that can also be done.', 'Die Aktivierung dieser Zahlungs-Gateway, wird das Geld zu 100% an den Besitzer des Paypal-Konto konfiguriert gehen. Diese Methode ist sehr einfach zu installieren, fügen Sie einfach die Geschäfts paypal E-Mail-Adresse, um die Zahlung zu empfangen und Sie sind fertig, wenn der Inhaber der Website will alle Zahlungen zu erhalten und dann zu zahlen, um die Unternehmer, die auch getan werden kann.', 'La activación de esta pasarela de pago, el dinero se destinará el 100% para el dueño de la cuenta de Paypal configurado. Este método es muy fácil de instalar, sólo tiene que añadir la dirección de correo electrónico de negocios de PayPal para recibir el pago y ya está, si el propietario del sitio quiere recibir todos los pagos y luego pagar al propietario de la empresa, que también se puede hacer.', 0);;
INSERT INTO w_lang_admin VALUES (646, '', true, NULL, 'This payment method allows to automatically split the payment between the business and the website owner, based on certain commision for example, the initial configuration of this payment gateway is done on the website settings screen. For more information about this please check https://developer.paypal.com/docs/classic/adaptive-payments/integration-guide/APIntro/', 'Diese Zahlungsmethode erlaubt es, automatisch die Zahlung aufgeteilt zwischen dem Unternehmen und dem Inhaber der Website, auf der Grundlage bestimmter Provision wird zum Beispiel die Anfangskonfiguration des Payment-Gateway auf der Website Einstellungen Screen. Für weitere Informationen über diese bitte https://developer.paypal.com/docs/classic/adaptive-payments/integration-guide/APIntro/', 'Este método de pago permite dividir automáticamente el pago entre el negocio y el propietario del sitio web, basado en cierta comisión por ejemplo, la configuración inicial de esta pasarela de pago se realiza en la pantalla de configuración del sitio web. Para obtener más información sobre esto, por favor verifique https://developer.paypal.com/docs/classic/adaptive-payments/integration-guide/APIntro/', 0);;
INSERT INTO w_lang_admin VALUES (647, 'BUSINESS_AUTHORIZE_DELIVERY', true, NULL, 'The user is allowed to pay directly on your site with his credit card, just create an authorize.net account and setup the details. An SSL may be required, to install the SSL please purchase it (we recommend godaddy) and contact us, we will install it on your site. This payment gateway is allowed on the US.', 'Der Benutzer kann direkt auf Ihrer Website mit seiner Kreditkarte zu bezahlen, nur eine authorize.net Konto und das Setup die Details zu schaffen. Ein SSL erforderlich sein, die Installation des SSL kaufen Sie bitte (wir empfehlen godaddy) und kontaktieren Sie uns, wir werden es auf Ihrer Website zu installieren. Das Payment-Gateway basiert auf dem US erlaubt.', 'El usuario está autorizado a pagar directamente en su sitio con su tarjeta de crédito, basta con crear una cuenta authorize.net y la configuración de los detalles. Un SSL puede ser necesario, para instalar el SSL favor comprarlo (recomendamos godaddy) y póngase en contacto con nosotros, vamos a instalarlo en su sitio. Se deja que esta entrada del pago en los EE.UU..', 0);;
INSERT INTO w_lang_admin VALUES (648, 'BUSINESS_BRAINTREE_DELIVERY', true, NULL, 'The user is allowed to pay directly on your site with his credit card, just create an https://www.braintreepayments.com/ account and setup the details. An SSL may be required, to install the SSL please purchase it (we recommend godaddy) and contact us, we will install it on your site. This payment gateway is allowed on the US.', 'Der Benutzer kann direkt auf Ihrer Website mit seiner Kreditkarte zu bezahlen, nur eine https://www.braintreepayments.com/ Konto und das Setup die Details zu schaffen. Ein SSL erforderlich sein, die Installation des SSL kaufen Sie bitte (wir empfehlen godaddy) und kontaktieren Sie uns, wir werden es auf Ihrer Website zu installieren. Das Payment-Gateway basiert auf dem US erlaubt.', 'El usuario está autorizado a pagar directamente en su sitio con su tarjeta de crédito, basta con crear una cuenta https://www.braintreepayments.com/ y la configuración de los detalles. Un SSL puede ser necesario, para instalar el SSL favor comprarlo (recomendamos godaddy) y póngase en contacto con nosotros, vamos a instalarlo en su sitio. Se deja que esta entrada del pago en los EE.UU..', 0);;
