INSERT INTO w_lang_admin VALUES (649, '', true, NULL, 'The user is allowed to pay with his credit card, just create an mercadopago.com account and setup the details. This payment gateway is allowed on Latin America', 'Der Benutzer kann mit seiner Kreditkarte zu bezahlen, nur eine mercadopago.com Konto und das Setup die Details zu schaffen. Das Payment-Gateway auf Lateinamerika erlaubt', 'El usuario se le permite pagar con su tarjeta de crédito, basta con crear una cuenta mercadopago.com y configurar los detalles. Se deja que esta pasarela de pago en América Latina', 0);;
