INSERT INTO w_lang_admin VALUES (651, '', true, NULL, 'The user is allowed to pay directly on your site with his credit card, just create an http://www.worldpay.com/ account and setup the details. An SSL may be required, to install the SSL please purchase it (we recommend godaddy) and contact us, we will install it on your site. This payment gateway is allowed mainly on the UK for more info visit their site.', 'Der Benutzer kann direkt auf Ihrer Website mit seiner Kreditkarte zu bezahlen, nur eine http://www.worldpay.com/ Konto und das Setup die Details zu schaffen. Ein SSL erforderlich sein, die Installation des SSL kaufen Sie bitte (wir empfehlen godaddy) und kontaktieren Sie uns, wir werden es auf Ihrer Website zu installieren. Das Payment-Gateway ist vor allem auf das Vereinigte Königreich für weitere Informationen besuchen Sie die Website erlaubt.', 'El usuario está autorizado a pagar directamente en su sitio con su tarjeta de crédito, basta con crear una cuenta http://www.worldpay.com/ y la configuración de los detalles. Un SSL puede ser necesario, para instalar el SSL favor comprarlo (recomendamos godaddy) y póngase en contacto con nosotros, vamos a instalarlo en su sitio. Esta pasarela de pago está permitido principalmente en el Reino Unido para obtener más información visite su sitio.', 0);;
