INSERT INTO w_lang_admin VALUES (655, '', true, NULL, 'VoguePay is a unique online payment processor whose vision is to offer buyers and sellers a secure and easy-to-use means of transacting business online. VoguePay allows site owners to recieve payment for their goods and services on their website without any setup fee.', 'VoguePay ist eine einzigartige Online-Payment-Prozessor, dessen Vision ist es, Käufer und Verkäufer eine sichere und einfach zu bedienende Hilfe von Online-Abwicklung von Geschäften bieten. VoguePay ermöglicht Website-Betreiber, die Zahlung für ihre Waren und Dienstleistungen auf ihrer Website ohne Einrichtungsgebühr erhalten.', 'VoguePay es un procesador de pagos en línea única cuya visión es ofrecer a los compradores y vendedores de un medio seguro y fácil de usar de realizar transacciones comerciales en línea. VoguePay permite a los propietarios del sitio para recibir el pago por sus productos y servicios en su página web sin ningún tipo de cuota de instalación.', 0);;
