INSERT INTO w_lang_admin VALUES (699, 'CONTROL_PANEL_APPS_BRINGG_DESCRIPTION', true, NULL, 'This amazing integration allows you to add uber like capabilities, track your drivers position and manage and assign drivers to your orders. For more information and pricing please visit bringg.com', 'Diese erstaunliche Integration ermöglicht es Ihnen, uber wie Fähigkeiten, Ihre Aufträge hinzuzufügen, verfolgen Sie Ihre Lokführer und zu verwalten und ordnen Treiber. Weitere Informationen und Preise finden Sie unter bringg.com', 'Esta integración increíble le permite añadir uber como capacidades, el seguimiento de su posición de los conductores y administrar y asignar a los conductores a sus órdenes. Para obtener más información y precios visite bringg.com', 0);;
