INSERT INTO w_lang_admin VALUES (1598, 'BUSINESS_CARD_DELIVERY', true, NULL, 'This payment method is almost as cash, there are some businesses that have mobile credit card terminals, those can either be like bank mobile terminal or smartphone credit card processors like Square. Basically the user places and order and pays with his credit card on his address when receiving the order.', 'Diese Zahlungsmethode ist fast wie Bargeld, gibt es einige Unternehmen, die mobilen Kreditkarten-Terminals haben, können diejenigen, entweder wie Bank mobilen Endgerät oder Smartphone Kreditkarten-Prozessoren wie Square. Grundsätzlich sind die Benutzer Orte und Ordnung und zahlt mit seiner Kreditkarte auf seinem Adresse, wenn Eingang der Bestellung.', 'Esta forma de pago es casi tan efectivo, hay algunas empresas que tienen terminales de la tarjeta de crédito móviles, ya sea los que pueden ser como los procesadores bancarios móviles terminales o teléfonos inteligentes de tarjetas de crédito, como la plaza. Básicamente los lugares de los usuarios y el orden y paga con su tarjeta de crédito en su discurso al recibir la orden.', 0);;
INSERT INTO w_lang_admin VALUES (1599, 'BUSINESS_PAYPAL_DELIVERY', true, NULL, 'Activating this payment gateway, the money will go 100% to the owner of the Paypal account configured. This method is really easy to setup, just add the business paypal email address to receive the payment and you are done, if the site owner wants to receive all the payments and then pay to the business owner that can also be done.', 'Die Aktivierung dieser Zahlungs-Gateway, wird das Geld zu 100% an den Besitzer des Paypal-Konto konfiguriert gehen. Diese Methode ist sehr einfach zu installieren, fügen Sie einfach die Geschäfts paypal E-Mail-Adresse, um die Zahlung zu empfangen und Sie sind fertig, wenn der Inhaber der Website will alle Zahlungen zu erhalten und dann zu zahlen, um die Unternehmer, die auch getan werden kann.', 'La activación de esta pasarela de pago, el dinero se destinará el 100% para el dueño de la cuenta de Paypal configurado. Este método es muy fácil de instalar, sólo tiene que añadir la dirección de correo electrónico de negocios de PayPal para recibir el pago y ya está, si el propietario del sitio quiere recibir todos los pagos y luego pagar al propietario de la empresa, que también se puede hacer.', 0);;
