INSERT INTO w_lang_admin VALUES (2294, 'BUSINESS_STRIPE_DELIVERY', true, NULL, 'The user is allowed to pay directly on your site with his credit card, just create an https://stripe.com account and setup the details. An SSL may be required, to install the SSL please purchase it (we recommend godaddy) and contact us, we will install it on your site. This payment gateway is allowed mainly on United States and United Kingdom.', 'Der Benutzer darf direkt auf Ihrer Website mit seiner Kreditkarte zu bezahlen, nur eine https://stripe.com Konto und Setup-Details erstellen. Ein SSL erforderlich sein, die Installation des SSL kaufen Sie es bitte (wir empfehlen godaddy) und kontaktieren Sie uns, wir werden es auf Ihrer Website zu installieren. Das Payment-Gateway basiert hauptsächlich auf USA und Großbritannien erlaubt.', 'El usuario está autorizado a pagar directamente en su sitio con su tarjeta de crédito, basta con crear una cuenta https://stripe.com y los detalles de configuración. Un SSL puede ser necesario, para instalar el SSL favor comprarlo (recomendamos GoDaddy) y póngase en contacto con nosotros, vamos a instalarlo en su sitio. Esta pasarela de pago está permitido principalmente en Estados Unidos y Reino Unido.', 0);;
