INSERT INTO w_lang_admin VALUES (2328, 'BUSINESS_PAYPALPRO_DELIVERY', true, NULL, 'The user is allowed to pay directly on your site with his credit card, just create an https://www.paypal.com/ account and setup the details. An SSL may be required, to install the SSL please purchase it (we recommend godaddy) and contact us, we will install it on your site. This payment gateway is allowed on the US.', 'Der Benutzer darf direkt auf Ihrer Website mit seiner Kreditkarte zu bezahlen, nur eine https://www.paypal.com/ Konto und Setup-Details erstellen. Ein SSL erforderlich sein, die Installation des SSL kaufen Sie es bitte (wir empfehlen godaddy) und kontaktieren Sie uns, wir werden es auf Ihrer Website zu installieren. Das Payment-Gateway basiert auf dem US erlaubt.', 'El usuario está autorizado a pagar directamente en su sitio con su tarjeta de crédito, basta con crear una cuenta https://www.paypal.com/ y la configuración de los detalles. Un SSL puede ser necesario, para instalar el SSL favor comprarlo (recomendamos GoDaddy) y póngase en contacto con nosotros, vamos a instalarlo en su sitio. Se deja que esta entrada del pago en los EE.UU..', 0);;
